        { id: 0, name: "Blue" },
        {
            id: 0,
            name: "Blue",
        },
    ];
    const [users, setUsers] = useState([]);
    const userList = users.map((user) => <li key={user}>{user}</li>);

    return <ul>{userList}</ul>;
};
